    public int maximalRectangle(char[][] matrix){
        if(matrix.length == 0 || matrix[0].length == 0){
            return 0;
        }
        int[][] cache = new int[matrix.length][matrix[0].length];
        for(int row = 0; row < matrix.length; ++row){
            int cul = 0;
            for(int col = matrix[0].length - 1; col >= 0; --col){
                if(matrix[row][col] == '0'){
                    cul = 0;
                    cache[row][col] = 0;
                }else{
                    cache[row][col] = ++cul;
                }
            }
        }
        int maxArea = 0;
        for(int row = 0; row < matrix.length; ++row){
            for(int col = 0; col < matrix[0].length; ++col){
                if((matrix.length - row) * (matrix[0].length - col) <= maxArea){
                    break;
                }
                if(matrix[row][col] == '1'){
                    int width = cache[row][col];
                    
                    if(width * (matrix.length - row) <= maxArea){
                        continue;
                    }
                    
                    for(int row2 = row; row2 < matrix.length && matrix[row2][col] == '1'; ++row2){
                        width = Math.min(width, cache[row2][col]);
                        int newArea = width * (row2 - row + 1);
                        if(maxArea < newArea){
                            maxArea = newArea;
                        }
                    }
                }
            }
        }
        return maxArea;
    }
